css:
@-moz-document url-prefix("http://www.baidu.com/"), url-prefix("https://www.baidu.com/"), url-prefix("http://baidu.com/"), url-prefix("https://baidu.com/"), url-prefix("https://ipv6.baidu.com/")
  {
    body
  {
    background: url('data:image/png;base64,') !important;
  }

  a
  {
    text-decoration: none !important;
  }

  #rs,.c-container,.result-op
  {
    background-color: #fff;
    border-radius: 10px;
    padding: 10px;
    box-shadow: 0 2px 5px 0 rgb(0 0 0 / 10%);
    transition: 0.2s all;
  }

  #rs:hover,.c-container:hover,.result-op:hover
  {
/*     box-shadow: 0 0 2px 2px #cecbcb; */
    background-color: #fff;
    box-shadow: 0 1px 8px rgba(32, 33, 36, 0.28);
    border-color: rgba(223,225,229,0);
  }

  #rs,[tpl="open_source_software"],[tpl="video_vast"]
  {
    width: 560px;
  }

  .hint_right_middle
  {
    display: none;
  }

  [tpl='tieba_star']
  {
    width: 560px;
  }

  #s_tab
  {
    padding-top: 70px !important;
  }

  .c-border
  {
    margin: 0 !important;
    width: 528px !important;
  }

  .c-result-content > div >div
  {
    margin-top: 9px !important;
  }

  [tpl="video_vast"] >p
  {
    float: right;
  }

  [tpl="video_vast"] >div
  {
    margin-top: 5px;
  }

  .c-group-wrapper
  {
    margin: 0;
  }

  [tpl="sp_realtime_bigpic5"]
  {
    margin-top: 20px;
  }

  .c-group-wrapper div.result-op
  {
    width: 550px !important;
  }

  .op_sp_realtime_group_title_new
  {
    width: 406px !important;
  }

[tpl="short_video_pc"]>div>div>div{
	margin-right: 9px !important;
}
